import { makeStyles } from '@material-ui/core/styles'

export const useStyles = makeStyles(theme => ({
    root: {
    },
    navLink: {
        color: '#fff',
        background: '#7E7E7E',
        margin: theme.spacing(1,1,1,1),
        '&:nth-child(even)': {
            background: '#707070',
        },
        '&:hover': {
            color: '#e7e7e7'
        }
    },
}))
